import React, { Component } from 'react';
import Shaded from './Shaded';
import Bar from './Bar';
import Line from './Line';
import getObservationBySeriesId from '../services/dataService';
import config from './config';

class Graph extends Component {

  constructor(props){
    super(props);
    this.state = {
      data : []
    };
  }

  getSeriesId(){
    switch(this.props.type){
      case 'shaded': 
        return ''
      case 'bar': 
        return <Bar data={this.state.data} />; 
      case 'line': 
        return <Line data={this.state.data}/>

      default:
        return 'No component to render';
    }
  }

  renderComponent(){
    switch(this.props.type){
      case 'shaded': 
        return <Shaded data={this.state.data} seriesId={config['SERIES_ID']['shaded']}/>;
      case 'bar': 
        return <Bar data={this.state.data} seriesId={config['SERIES_ID']['bar']}/>; 
      case 'line': 
        return <Line data={this.state.data} seriesId={config['SERIES_ID']['line']}/>

      default:
        return 'No component to render';
    }
  }

  render() {
    return (
      this.renderComponent()
    );
  }
}

export default Graph;
